import React, { Component } from 'react'
import Input from '../../general/Input';
 class Addproduct extends Component {
  constructor(props){
    super(props)
      this.state={
        name:"",
        description:"",
        price:"",
        brand:"",
        quantity:""
      };
  }
   onChange=()=>{
    console.log("on change"); 
   }
  render() {
    const { name, description, price ,brand, quantity} =this.state;
    return (
      <div className='from-group'>
        <Input  
        name="name"
        type="text"
        placeholder="name of product"
        value={name}
        onChange={this.onChange}
        />
        <Input  
        name="name"
        type="text"
        placeholder="name of product"
        value={name}
        onChange={this.onChange}
        />
        <Input  
        name="description"
        type="text"
        placeholder="description"
        value={description}
        onChange={this.onChange}
        />
        <Input  
        name="price"
        type="text"
        placeholder="enter the price"
        value={price}
        onChange={this.onChange}
        />
        <Input  
        name="brand"
        type="text"
        placeholder="enter the price"
        value={brand}
        onChange={this.onChange}
        />
        <Input  
        name="quantity"
        type="text"
        placeholder="enter the quantity"
        value={quantity}
        onChange={this.onChange}
        />
        <Input  
        name="nameprice"
        type="text"
        placeholder="enter the price"
        value={price}
        onChange={this.onChange}
        />
        <div>
          <select className='from-control'>

          </select>
        </div>
      </div>
    )
  }
}
export default Addproduct;
